import React from "react";
import { Card } from "./Card";

const data = [
  {
    id: 1,
    src: "https://wallpapercave.com/wp/wp4056410.jpg",
    category: "A Netflix Original Series",
    title: "DARK",
  },
  {
    id: 2,
    src: "https://wallpapercave.com/wp/wp4056410.jpg",
    category: "A Netflix Original Series",
    title: "DARK",
  },
  {
    id: 3,
    src: "https://wallpapercave.com/wp/wp4056410.jpg",
    category: "A Netflix Original Series",
    title: "DARK",
  },
];

const App = () => {
  return (
    <>
      {data.map((item) => (
        <Card
          key={item.id}
          src={item.src}
          category={item.category}
          title={item.title}
        />
      ))}
    </>
  );
};

export default App;
